    private LMSProductInfo(final String inSerialNumber, final String inCustomerInfo, final String[] inCustomerCode) {
        this.serialNumber = inSerialNumber;
        this.customerInfo = inCustomerInfo;
        this.customerCode = inCustomerCode;
    }
    
    public static int getProductLength() {
        return LMSProductInfo.productInfo.length;
    }
    
    public static boolean cmpSerialNum(final int sensorID) {
        if (LMSTelegram.serialNumber[sensorID] == null || LMSTelegram.serialNumber[sensorID].equals("")) {
            return false;
        }
        for (int loop = 0; loop < getProductLength(); ++loop) {
            if (LMSProductInfo.productInfo[loop].serialNumber.equals(LMSTelegram.serialNumber[sensorID])) {
                LMSLog.d("LMSProductInfo" + sensorID, "serialNumber[" + loop + "]=" + LMSTelegram.serialNumber[sensorID]);
                LMSProductInfo.customerCode0 = LMSProductInfo.productInfo[loop].customerCode;
                return true;
            }
        }
        final String md5 = Md5.string2MD5(LMSTelegram.serialNumber[sensorID]).toUpperCase();
        try {
            for (final String str : LMSProductInfo.productList) {
                final String fileMd5 = str.substring(0, 32).toUpperCase();
                LMSLog.d("LMSProductInfo", "fileMd5=" + fileMd5);
                if (fileMd5.equals(md5)) {
                    return true;
                }
            }
        }
        catch (StringIndexOutOfBoundsException e) {
            LMSLog.exception((Throwable)e);
        }
        return false;
    }
    
    public static void generateProductInfoOuter() {
        try {
            final FileReader fileReader = new FileReader("License.ini");
            final BufferedReader bufferedReader = new BufferedReader(fileReader);
            String lineStr;
            while ((lineStr = bufferedReader.readLine()) != null) {
                LMSProductInfo.productList.add(lineStr);
            }
        }
        catch (FileNotFoundException e) {
            LMSLog.exception((Throwable)e);
        }
        catch (IOException e2) {
            LMSLog.exception((Throwable)e2);
        }
    }
    
